import React from "react";

export default function Synonyms(props) {
  console.log(props.synonyms);
  if (props.synonyms) {
    <div className="Synonyms">
      {props.synonyms.map(function (synonyms, index) {
        return (
          <ul key={index}>
            <li>{synonyms}</li>
          </ul>
        );
      })}
    </div>;
  } else {
    return null;
  }
}
